// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

import "../token/Fighter.sol";
import "../core/CardShop.sol";
import "../authority/Member.sol";
import "../libraries/NftLibrary.sol";

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

/**
 * @title Fighter Z Token Card Shop
 *
 * @author Bit Lighthouse. Ace
 * AT: 2021-3-28 | VERSION: v1.0.2
 */

contract CardReward is Member {
    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.UintSet;

    address[] private _users;

    mapping (uint16 => bool) private _specials;

    mapping (uint8 => NftLibrary.RateStruct) public _rates;
    mapping (address => NftLibrary.UserStruct) private _usr;
    mapping (address => EnumerableSet.UintSet) private _tokens;

    struct RankStruct { address account; uint256 power; }
    event Claim(uint256 reward, uint256 power, uint256 total_power);
    event Redeemed(uint256 reward, uint256 surpls);
    event DoExchange(uint16 rate, uint256 reward, uint256 surpls);

    constructor(address auth_) Member(auth_) {
        configs["POWERS"] = 0;
        configs["REWARD"] = 1e26;

        _rates[1] = NftLibrary.RateStruct(7, 35, 7);
        _rates[2] = NftLibrary.RateStruct(3, 10, 1);
        _rates[3] = NftLibrary.RateStruct(5, 5, 1);
        _rates[4] = NftLibrary.RateStruct(10, 1, 1);
        _rates[5] = NftLibrary.RateStruct(0, 0, 0);
    }

    function _getSecondReward() private view returns
        (uint256 sr) {

        sr = configs["REWARD"].div(365);
        sr = sr.div(24).div(60).div(60);
    }

    function _doBurn(
        address account_, uint8 power_, uint112 tokenId_
    ) private {
        _tokens[account_].remove(tokenId_);
        configs["POWERS"] = configs["POWERS"] - power_;
        _usr[account_].powers = _usr[account_].powers - power_;
    }

    function _fresRecord(address to_, uint112 tokenId_, bool genre)
        private {

        NftLibrary.DetailStruct memory cs;
        cs = NftLibrary.analysis(tokenId_);

        if (genre == true) {
            _tokens[to_].add(tokenId_);
            _usr[to_].powers = _usr[to_].powers + cs.quality;
            configs["POWERS"] = configs["POWERS"] + cs.quality;

            if(_tokens[to_].length() <= 0) { _users.push(to_); }
            if (cs.quality == 1) { _specials[cs.heroId] = true; }
            if (_usr[to_].period <= 0) { _usr[to_].period = block.timestamp; }
        } else {
            _tokens[to_].remove(tokenId_);
            _usr[to_].powers = _usr[to_].powers - cs.quality;
            configs["POWERS"] = configs["POWERS"] - cs.quality;
        }
    }

    function setRewardRate(
        uint8 quality_, uint8 number_, uint16 rate_, uint8 times_
    ) public CheckPermit("CONFIG") {
        _rates[quality_].number = number_;
        _rates[quality_].rate = rate_;
        _rates[quality_].times = times_;
    }

    function doBuy(address to_, uint112 tokenId_) public
        CheckPermit("CARDSHOP") {

        _fresRecord(to_, tokenId_, true);
    }

    function doExchange(address from_, address to_, uint112 tokenId_)
        public CheckPermit("EXCHANGE") {

        if (from_ != address(0)) _fresRecord(to_, tokenId_, false);
        if (to_ != address(0)) _fresRecord(to_, tokenId_, true);
    }

    function getReward(address account_) public view
        returns (uint256 reward) {

        uint256 second_reward = _getSecondReward();

        uint256 power_rate = _usr[account_].powers.mul(1e8);
        power_rate = power_rate.div(configs["POWERS"]).div(1e8);
        uint256 period = block.timestamp - _usr[account_].period;

        reward = second_reward.mul(period).mul(power_rate).div(100);
    }

    function getUserPower(address account_) public view
        returns (uint256 power) {

        power = _usr[account_].powers;
    }

    function getUserToken(address account_, uint256 i) public
        view returns (uint256 tokenId) {

        tokenId = _tokens[account_].at(i);
    }

    function getTotalPower() public view returns (uint256 power) {
        power = configs["POWERS"];
    }

    function getTokenList(address account_) public view
        returns (NftLibrary.DetailStruct[] memory list) {

        uint256 len = _tokens[account_].length();
        list = new NftLibrary.DetailStruct[](len);

        for (uint i = 0; i < len; i++) {
            uint256 tokenId = _tokens[account_].at(i);
            list[i] = NftLibrary.analysis(uint112(tokenId));
            list[i].tokenId = uint112(tokenId);
        }
    }

    function getRanking() public view returns (RankStruct[] memory rank) {
        rank = new RankStruct[](_users.length);

        for (uint i = 0; i < _users.length; i++) {
            uint256 power = _usr[_users[i]].powers;
            rank[i] = RankStruct(_users[i], power);
        }
    }

    function claim() public CheckStatus("CLAIM") {
        uint256 reward = getReward(msg.sender);
        require(reward > 0, "FIGHTER: The reward is zero.");

        _usr[msg.sender].period = block.timestamp;

        address sender = authority.members("FOUND");
        IERC20 token = IERC20(authority.members("TOKEN"));

        token.transferFrom(sender, msg.sender, reward);

        emit Claim(reward, _usr[msg.sender].powers, configs["POWERS"]);
    }

    function redeemed(uint112 tokenId_) public CheckStatus("REDEEMED") {
        Fighter figh = Fighter(authority.members("FIGHTER"));

        require(
            msg.sender == figh.ownerOf(tokenId_),
            "CARDREWARD: Only onwer."
        );

        address sender = authority.members("FOUND");
        IERC20 token = IERC20(authority.members("TOKEN"));

        NftLibrary.DetailStruct memory cs;
        cs = NftLibrary.analysis(tokenId_);

        uint256 reward = uint256(cs.amount);
        reward = reward.mul(uint256(cs.rate)).div(100);
        require(reward > 0, "FIGHTER: Reward is zero.");
        token.transferFrom(sender, msg.sender, reward);

        address shop = authority.members("CARDSHOP");
        CardShop(shop).fresh(cs.quality, cs.heroId);
        figh.doBurn(tokenId_);
        _doBurn(msg.sender, cs.quality, tokenId_);

        emit Redeemed(reward, token.balanceOf(sender));
    }

    function exchange(uint8 quality_) public CheckStatus("EXCHANGE") {
        Fighter figh = Fighter(authority.members("FIGHTER"));
        uint256 total = 0;

        uint256 length = figh.balanceOf(msg.sender);
        uint64[] memory tokens = new uint64[](length);

        for (uint256 i = 0; i < length; i++) {
            uint256 tokenId = _tokens[msg.sender].at(i);
            NftLibrary.DetailStruct memory cs;
            cs = NftLibrary.analysis(uint112(tokenId));

            if (cs.quality != quality_) continue;

            total = total + 1;
            tokens[i] = uint64(tokenId);
        }

        NftLibrary.RateStruct memory rs = _rates[quality_];
        require(
            rs.number > 0 && total >= rs.number,
            "CARDREWARD: Insufficient number of NFTs."
        );

        NftLibrary.UserStruct memory us = _usr[msg.sender];
        require(
            total / rs.number < us.exchange || us.exchange == 0,
            "CARDREWARD: Have no reward to exchange."
        );

        address sender = authority.members("FOUND");
        IERC20 token = IERC20(authority.members("TOKEN"));

        uint256 balance = token.balanceOf(sender);
        uint256 reward = balance.mul(rs.rate).div(100);

        token.transferFrom(sender, msg.sender, reward);
        _usr[msg.sender].exchange = _usr[msg.sender].exchange + 1;

        CardShop shop = CardShop(authority.members("CARDSHOP"));

        for (uint256 i = 0; i < length; i++) {
            if (tokens[i] <= 0) continue;

            figh.doBurn(tokens[i]);
            _doBurn(msg.sender, quality_, tokens[i]);
            shop.fresh(quality_, uint16(tokens[i] >> 47));
        }

        emit DoExchange(rs.rate, reward, token.balanceOf(sender));
    }
}

